import useAuthContext from '../login/useAuthContext';

function Navbar(){

  const {logout} = useAuthContext();

  return (
    <nav class="navbar navbar-dark bg-dark">
      <div class="container">
        <a class="navbar-brand" href="/">
          <img src="https://static.wixstatic.com/media/2cd43b_fd0aba46da664bba9992400e48d51338~mv2_d_3543_4502_s_4_2.png/v1/fill/w_320,h_406,q_90/2cd43b_fd0aba46da664bba9992400e48d51338~mv2_d_3543_4502_s_4_2.png" alt="" width="30" height="30"></img>
        </a>
      </div>
      <button type="button" class="btn btn-danger pl-10" onClick={logout()}>Cerrar sesión</button>
    </nav>
  )
}

export default Navbar;
